import React from "react";
// import { NavLink } from "react-router-dom";
// import web from "../src/Images/careerimg.png";
import Common from "./Common";

const Home = () => {
    return (
        <>
           <Common
            name=' Welcome To  Home Page '
             img src={web} 
             visit="/contact" 
             btName="Contact Now" 
           />

        </>

    );

};
export default Home;
